import React from "react";

function Header() {
  return (
    <header>
      <div>
        <h1>Crypto Exchange Dashboard</h1>
      </div>

      <div className="navbar-buttons">
        <h3>Log In</h3>
        <h3>Sign Up</h3>
      </div>
    </header>
  );
}
export default Header;
